    dp = [[0] * n for _ in range(n)]
    ans = 'MUTATED'
    for i in range(n):
        dp[i][i] = 1
        ans = s[i]
    for i in range(n - 1):
        if s[i] == s[i + 1]:
            dp[i][i + 1] = 1
            ans = s[i:i + 2]
    for start in range(n - 1, -1, -1):
        for end in range(start + 2, n):
            if s[start] == s[end]:
                dp[start][end] = dp[start + 1][end - 1]
            else:
                dp[start][end] = max(dp[start + 1][end], dp[start][end - 1])
            if dp[start][end] > len(ans):
                ans = s[start:end + 1]
    return ans

